import React from 'react';
import Grid from '@mui/material/Grid';
import NavBar from '../Components/NavBar';
import Banner from '../Components/Banner';

const Home = () => {
  return (
    <div style={{ backgroundColor: '#EDE4E0' }}>
      <Grid>
        <Grid item>
          <NavBar />
        </Grid>
        <Grid item>
          <Banner />
        </Grid>
      </Grid>
    </div>
  )
};

export default Home;
